import React from 'react';
import {IonRow, IonButton} from '@ionic/react';
import { useHistory } from 'react-router-dom';
import { RouteComponentProps, withRouter } from 'react-router';

type SomeComponentProps = RouteComponentProps;

const TestController: React.FC<{onVerify: () => void; SomeComponentProps: () => {history}}> = props => {
    const history = useHistory();
    const goHome = () => history.push('/Main');
    
    return (
        <IonRow class="ion-justify-content-center" style={{marginTop:"10%"}}>
            <IonButton size="large" id="doneBtn" type="submit" onClick={props.onVerify} >DONE</IonButton>
        </IonRow>
    );
}

export default TestController;
